import React from 'react';

import ClipLoader from "react-spinners/ClipLoader";

export default function Spinner() {
  return (
    <>    
<ClipLoader
        color="red"
        loading={50}
        // cssOverride={override}
        size={150}
        aria-label="Loading Spinner"
        data-testid="loader"
      />
    </>
  )
}
